import React, { Component } from 'react';
import axios from 'axios';
import './Blog.css';
import Posts from './Posts/Posts';

class Blog extends Component {

    render () {


        return (
            <div className="Blog">
                <header>
                    <nav>
                        <ul>
                          <li><a href="/">Home</a></li>
                          <li><a href="/">New Post</a></li>
                        </ul>
                    </nav>
                </header>
                <section>
                    <FullPost id={this.state.selectedPostId}/>
                </section>
                <section>
                    <NewPost />
                </section>
                <Posts />
            </div>
        );
    }
}

export default Blog;
